<body>
    <script>
        function fn2(arr) {
            for (var i = 1; i < arr.length; i++) {
                for (var j = i; j > 0; j--) {
                    if (arr[j - 1] > arr[j]) {
                        [arr[j - 1], arr[j]] = [arr[j], arr[j - 1]]
                    }
                }
            }
            console.log(arr)
        }
        var arr = [5, 7, -1, 9, 11, 3, 6, 33, 12]
        fn2(arr)
    </script>
</body>
